Mercado amarelado descendo a lenha no adversário, claramente envolvido com esquema de apostas;
Lucca ( atacante do Inter ) assistiu o jogo dentro de campo;
Eduardo Coudet com cabelo molhado evidência a calvície;
Keiller sendo Keiller.

